import React from 'react'
import { useEffect,useState } from 'react'
function App() {
  const [todo,setTodo]= useState([
    {
      id : 1,
      title : 'todo'
    }
   
  ]
  )
  console.log(todo)
  return (
    <div>
      {
        todo.map(item=>{
          <h1 key={item}>{item.title}</h1>
        })
      }
    </div>
  )
}

export default App
